import React from 'react';
import './Avilable.css';
import Avilableitem from './Avilableitem';


function Avilable() {
  return (
    <div className='avilable-main'> 
        <span>Avilable</span>
        <div className='avilable-main-list'>
        <Avilableitem
        type='Sample Type1 '
        brand='Sample Brand 1'
        location='Sample Location 1'
        date='Sample Date 1'
        />
        </div>
    </div>
    
  )
}

export default Avilable
